import React from 'react';

const WordsContainer = ({words}) => {

  const renderWords = () => {
    return words.map(word => {
      return <div>{word.simplified}</div>
    })
  }


  return (
    <div>
      {renderWords()}
    </div>
  )
}

export default WordsContainer;
